class WfHeaderComponent extends BaseComponent {
    constructor() {
        super(...arguments);
        this.useAppLogo = true;
        this.useSystemAndUser = true;
        this.useMenu = true;
        this.useSupportLink = false;
        this.useLogoutButton = false;
        this.bcLogoClick = new EventEmitter();
        this.supportLinkClick = new EventEmitter();
        this.logoutClick = new EventEmitter();
    }
    set supportMenuItems(m) {
        this._supportMenu = m;
    }
    get supportMenuItems() { return this._supportMenu; }
    get useSupportMenu() { return !!this._supportMenu; }
    onMenuClick() {
        this.menuState = this.menuState == 'expanded' ? 'hidden' : 'expanded';
    }
    onBCLogoClick() {
        this.bcLogoClick.emit();
    }
    onSupportLinkClick() {
        this.supportLinkClick.emit();
    }
    onLogoutClick() {
        this.logoutClick.emit();
    }
    get bcLogoClickEnable() {
        return this.bcLogoClick.observers.length > 0;
    }
}
